import React from 'react';
import './About.css';

const NavBar = () => {
  return (
    <div className='hero'>
      <nav>
        <h2 className='logo'>Learn<span>ify</span></h2>
        <button type='button' className='button'>Login</button>
      </nav>
      <div className='title'>
        <h1 className='heading'>Learnify</h1>
        <h3 className='subheading'>Unlocking the power of knowledge, together</h3>

      </div>
    </div>
  );
};

export default NavBar;
